import React from 'react'
import {List, Header} from "semantic-ui-react";

const Quizzes = ({ quizzes }) => {
    console.log("Hello")
    console.log(quizzes)
    return (
        <ul>
            {quizzes.map(quiz => {
                console.log(quiz);
            return(
                <li key={quiz.quiz_name}>
                    {quiz.quiz_id}
                </li>
                )
            })}
        </ul>
    )
}

export default Quizzes
